If u open the .ifo-file with a dvd-program u can play the whole dvd instead of playing each of the vob-files separately... I tested it in Nero Showtime, and it played norwegian audio in every chapter throughout the movie... So THERE IS NORWEGIAN AUDIO on this one. Hate it when noobs misinform me...Good thing I forgot to read the comments before I downloaded it..

Thanx for the upload, Jack_D   :-D
